# Zhuravlyovka, Republic of Bashkortostan

}}
Zhuravlyovka () is a rural locality (a village) in Meselinsky Selsoviet, Aurgazinsky District, Bashkortostan, Russia. The population was 19 as of 2010. There is 1 street.
Geography
Zhuravlyovka is located 33 km south of Tolbazy (the district's administrative centre) by road. Meseli is the nearest rural locality.
